import json
from PySide2.QtGui import QFont

from log import Logger

version = '0.1.0'

key_otp_key = 'otp_key'
key_last_otp = 'last_otp'
key_current_otp = 'current_otp'
key_running = 'running'

icon = ''
icon_small = ''
person_logo = ''
font = QFont()
font.setFamily("微軟正黑體")


class Config:
    def __init__(self, console):

        self.console = console
        self.data = dict()
        self.loaded = False

        self.logger = Logger('Config', Logger.INFO)

    def load(self):
        if self.console.ptt_id is None:
            self.logger.show_value(Logger.INFO, 'load fail', 'ptt id is None')
            return
        current_path = f'./data/{self.console.ptt_id}/config.txt'
        try:
            with open(current_path, encoding='utf8') as f:
                self.data = json.load(f)
            self.logger.show_value(Logger.INFO, 'Load from data', 'Active')
        except FileNotFoundError:
            self.logger.show_value(Logger.INFO, 'Create new data', 'Active')
            self.data = dict()

        self.loaded = True

    def set(self, key, data):
        self.data[key] = data

    def get(self, key):
        if key not in self.data:
            return None

        return self.data[key]

    def write(self):

        if self.console.ptt_id is None:
            return
        current_path = f'./data/{self.console.ptt_id}/config.txt'
        with open(current_path, 'w', encoding='utf8') as f:
            json.dump(self.data, f, indent=4, ensure_ascii=False)
